import React, { Component } from 'react';

class ArtistGig extends Component {


componentDidMount = () => {
    fetch(this.props.gig.eventsHref + "?apikey=XyKG4KDNOliuaDev")
    .then(resp => resp.json())
    .then(data => console.log(data))
}


    render() {
        return(
            <div>
                this works?
            </div>
        )
    }

}

export default ArtistGig
